import './App.css';
import Navbar from './js/Navbar';
import Home from './js/Home';
import { Routes, Route, Router} from 'react-router-dom';

function App() {
  return (
    <Router>
      <div className="App">
        <Navbar />
        <Routes>        
          <Route path="/" element={<Home />} />
          {/* ... other routes ... */}
        </Routes>
      </div>
    </Router>
  );
}

export default App;
